import {createBrowserRouter} from "react-router-dom"
import Main from "../layout/Main/Main"
import Home from "../Pages/Home/Home";

const routes = createBrowserRouter([
    {
        path: "/",
        element: <Main/>,
        children: [
            {
                path: "/",
                element: <Home/>
            }
            
        ]
    }
]);

export default routes;
